<h3>音游</h3>
<h4>Phigros</h4>`,readingTime:{minutes:8.18,words:2454},title:"2024 年终总结",type:"article"}}],["/40%20Archive/%E5%8D%9A%E5%AE%A2/%E6%B8%B8%E8%AE%B0/CSP%20J%20%EF%BC%8FS2024.html",{loader:()=>L(()=>import("./CSP J ／S2024.html-CkXwWV0e.js"),[]),meta:{date:17299008e5,category:["blog"],tag:["CSP","游记"],isOriginal:!0,excerpt:`<p>在考这次的时候，这是一篇初三蒟蒻的游<s>玩</s>记<s>录</s></p>
<h2>Day -1</h2>
<p>完全没复习，全写作业去了(悲)<br>
作业疑似有点太多了<br>
